import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';  
import Header from './componentes/Header';
import Footer from './componentes/Footer';
import Home from './paginas/Home';
import Registro from './paginas/Registro';
import Login from './paginas/Login';
import Dashboard from './paginas/Dashboard';
import AdminDashboard from './paginas/AdminDashboard';
import PolicyViewer from './componentes/PolicyDetail';
import TermsDetail from './componentes/TermsDetail';
import DisclaimerDetail from './componentes/DisclaimerDetail';
import ForgotPassword from './paginas/ForgotPassword';
import ResetPassword from './paginas/ResetPassword';
import { AuthProvider } from './componentes/AuthContext';

function App() {
  return (
    <Router>
      <div className="App">

        <Header />
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/registro" element={<Registro />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/admin-dashboard" element={<AdminDashboard />} />
            <Route path="/politicas/:id" element={<PolicyViewer />} />
            <Route path="/terminos/:id" element={<TermsDetail />} />
            <Route path="/deslinde/:id" element={<DisclaimerDetail />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />
            <Route path="/reset-password" element={<ResetPassword />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
